import React from 'react'


var Timer = function() {
    var date = new Date();
    var sec = date.getSeconds();
    var min = date.getMinutes();
    document.getElementById("time").textContent = (min < 10 ? "0" + min : min) + ":" + (sec < 10 ? "0" + sec : sec);
  };
  setInterval(Timer, 1000);
  Timer();


export default Timer
